        review_text:
          "Restauracja usytuowana przy ulicy, z duzymi oknami ktore zapewniaja duzo swiatla. Stoliki ustawione dosc blisko ale, nie jest to problemem. Do wyboru sa dwie sale, dolna wieksza i troche glosniejsza oraz gorna, mniejsza i spokojniejsza- wybralismy gorna. Obsluga bardzo mila i pomocna, ogolny odbior jest taki  ze nikt nie pracuje tam za kare. Co do jedzenia na przystawke wzielismy tatara ktory byl dobry (cebulka jest od razu wymieszana z miesem), oraz zapiekanego camemberta z orzechami i winogronami- byl fenomenalny, idealnie wywazony smak i podany goracy tak ze ser byl idealnie ciagnacy. Do obu dan byl koszyczek pieczywa. Na dania glowne wybralismy klasycznego schabowego z puree z ziemiakow z koperkiem i fasolke szparagowa z bulka tarta- wszystko bardzo dobre, kotlet jest duzy, dosc cienki ale sklada sie glownie z miesa a nie z panierki- generalnie dobrze zrobiona klasyka. Danie drugie to golabki wegetarianskie w sosie kurkowym, sa napelnione kasza peczak i grzybami. Do tego swietnie doprawione, kapusta miekka a sos idealnie kremowy. Sa to dwa solidne golabki wiec raczej nie trzeba do nich dodatkow. Do zamowienia dodalismy jeszcze piwo (jest wybor kilku rodzajow) wode, oraz miks salat z sosem winegret. Wiec polecam serdecznie, mozna tu w spokoju usiasc i zjesc ale, tez napic sie kawy i z okna popatrzec na ulice i park. Jedyne o czym trzeba pamietac to do czesci dan trzeba dobierac dodatkowo platne dodatki- ale to wystarczy dokladnie czytac karte ;)",
