          "Zamowilem pizze i przyjechala zimna i sucha, mimo iz na zewnatrz jest 30 stopni. Wnioskuje, ze musiala lezec przed przywiezieniem, bo dojazd do mnie trwal okolo 5 min (wedlug aplikacji). Dodatkowo szpinak jest calkowicie wysuszonym wiorem.\n\nDodatkowo nie otrzymalem zamowionego sosu...\n\n[edit] Odpowiedz restauracji tylko potwierdza to co napisalem. Pizza lezala przed przekazaniem dostawcy. I tak, restauracja odpowiada za to z kim wspolpracuje, wiec odpowiada tez za jakosc dostawy. Jadlem te pizze na miejscu i szpinak nie byl taki obrzydliwie suchy, brak sosu nie skomentowany. Faktycznie mialem 2 nieodebrane polaczenia od restauracji, wiec to na plus, ze chcieli naprawic blad.",
