          'Kilka dni temu odwiedzilismy z mezem to miejsce. Przyznam szczerze ze ciezko mi ocenic ta restauracje. Obsluga byla mila, zostalismy dosyc szybko obsluzeni.Karty menu byly niesamowicie obskurne. Odchodzaca folia,powycierana miejscami ze ciezko bylo przeczytac.Na przystawke wzielismy tatar i smazonego camemberta. Ser byl naprawde super, po rozcieciu wylewal sie na talerz , w polaczeniu z dzemem wszystko smakowalo super. Co do tatara mam mieszane uczucia. Przyjemnym doswiadczeniem bylo to jak Pani z obslugi przyszla z ogromnym mlynkiem aby doprawic tatara swiezo zmielonym pieprzem. Dodatkow bylo kilka ale przy tak grubo posiekanym miesie bylo ich zdecydowanie za malo. W calym daniu byly one kompletnie nie wyczuwalne. Kostka masla do grzanek byla za zimna przez co slabo sie rozprowadzala mimo cieplego pieczywa. Zanim cale danie wymieszalam, doprawilam, wysmarowalam to minelo chyba z jakies 10 minut. A i tak nie udalo mi sie tego dobrze doprawic. Dania glowne niestety porazka. Byly okropnie suche, przesmazone. Devolay rozumiem, ze nie musi "sikac" maslem ale po rozcieciu tego masla kompletnie tam nie bylo. Panierka po prostu lamala sie przez to wysuszenie. Sznycel rowniez okropnie suchy. Cale doswiadczenie nie bylo zbyt przyjemne i napewno nie polece tego miejsca znajomym.',
