        review_text:
          'Po kilku latach postanowilam odwiedzic to miejsce.  Odwiedziny znajomego , ktory mial ochote na polskie jedzenie temu sprzyjaly. Pierwsze zdziwienie na poczatek - dostalismy karte napisana cyrylica. Nasza rozmowa nie wskazywala na to , ze znamy ten jezyk. Pani, ktora nas obslugiwala przedstawila sie (Katarzyna) i powiedziala , ze bedzie obslugiwac nasz stolik. Znajomy zapytal czym roznia sie piwa , ktore sa w karcie i w odpowiedzi uslyszal ich znazwy. Nie kazdy musi znac piwa serwowane w Polsce. Zamowilismy picie, dla mnie jedzenie , a znajomy powiedzial, ze dopiero za dwadziescia minut bedzie chcial zamowic jedzenie. Niestety, nie mial okazji. Przez nastepna godzine nikt nie zainteresowal sie, czy wszystko w porzadku i czy chcemy cos jeszcze zamowic. Zastanawialismy sie , czy to braki w obsludze sa tego przyczyna , ale obsluga w tym czasie dwa razy spiewala "sto lat" przy innych stolikach i miala czas ustalac " ze jeden ze stolikow bedzie mial doliczone 20% za serwis".',
        published_at: "tydzien temu",
        published_at_date: "2024-10-25T18:42:22",
        response_from_owner_text:
          "Dziekujemy za poswiecenie czasu na podzielenie sie swoimi wrazeniami z wizyty. Jest nam bardzo przykro, ze nie sprostalismy Panstwa oczekiwaniom.\nPrzepraszamy za niewlasciwie dobrane menu oraz brak informacji na temat serwowanych piw - doceniamy te uwage i zadbamy, aby nasi pracownicy byli lepiej przygotowani do udzielania informacji. Rowniez ubolewamy nad dlugim czasem oczekiwania na obsluge oraz brakiem uwagi ze strony naszej kelnerki. Panstwa uwagi wskazuja na niedociagniecia w organizacji pracy, na ktore zwrocimy szczegolna uwage. Takie sytuacje nie powinny miec miejsca.\nDziekujemy za szczere slowa. Z pewnoscia wykorzystamy je, aby poprawic jakosc obslugi i mamy nadzieje, ze mimo tych doswiadczen zechca Panstwo dac nam szanse w przyszlosci, abysmy mogli pokazac sie z lepszej strony.",
