          "Miejsce ma super atmosfere i wystroj. Zupa cebulowa z serem byla bardzo aromatyczna i chleb na boku idealne pasowal, porcja byla w sam raz. Stek i krewetki podane na goracym kamieniu robia wrazenie, sa super zaprezentowane. Sosy na boku ( pesto bazylia, pesto papryka oraz sos teriyaki) pieknie pasowaly do krewetek jak i steku. Kopytka z sosem truflowym mialy perfekcyjnie dopasowana ilosc skladnikow, sos delikatnie ziemny i slony dobrze laczyl sie z kopytkami, ser posypany na wierzchu dodawal fajny akcent serowy. Beza chrupka na zewnatrz mieciutka w srodku, miala perfekcyjna konsystencje, pokruszone pistacje dodawaly nowy smak jak i orzechy, ja dodalabym jeszcze lekki sos owocowy do bezy.\nMarchewka z fasola edamame miala lekki slodki smak co pieknie komponowalo sie z reszta dan. Pozdrawiam Pana Wojtka ktory nas obslugiwal, byl bardzo mily i bila od niego pozytywna energia :) :D",
