          "https://www.google.com/maps/contrib/115221263460703999448?hl=pl",
        review_text:
          "Wyjatkowe miejsce na wyjatkowe okazje (u nas rocznica slubu). Nastrojowo i klimatycznie. Tak przywital nas Stary Dom w to chlodne i wietrzne lipcowe popoludnie. Wnetrze wykonczone duza iloscia drewna i oswietlone wieloma lampkami i swiecami, z kwiatowymi dekoracjami, sprawia, ze od razu robi sie blogo. Nastroj to tez kojaca muzyka, stare, znane kawalki, nawet przedwojenne. A jak jeszcze traficie na pana Daniela, to Wasza wizyta bedzie wprost doskonala. Pan Daniel to klasa, blyskotliwosc, swietne poczucie humoru i autentyczna troska o klientow. Naprawde niezwykle sympatyczny czlowiek. Pomogl nam wybrac z menu: tatara (to wiadomo) i 2 salatki (z burrata i wiosenna). Do tego woda, herbata, kawa i sernik. Wszystko podane sprawnie, na pieknej porcelanie Villeroy & Boch. Tatar przepyszny, o aksamitnej teksturze, z grzybkami i cebulka. Wyrazisty w smaku. Spora porcja. Do tego kilka rodzajow pieczywa i maselko. Salatka z burrata  smaczna (podziwiam bohatera drugiego planu z kuchni, ktory obiera pomidorki koktajlowe ze skorki), ale moje serce skradla salatka wiosenna z rucola, ziemniaczkami, pomidorkami, groszkiem, jajkiem, bobem i pysznym dresingiem. Sernik z rodzynkami, jak u babci. Ogolnie niebo w gebie i nie dalismy rady zjesc nic wiecej. Moge tylko powiedziec: do zobaczenia!",
