          "Jest to miejsce z niepowtarzalnym klimatem, wystroj i cala otoczka jest naprawde wspaniala.\nNa przystawke postawilismy na trzy zupy oraz Tatara. Zurek, rosol oraz zupe dnia- pomidorowa.\nDo przystawek otrzymalismy przepyszny chleb wraz z maselkiem.\nZurek oraz rosol dosyc klasyczny, smaczny bez zadnych zarzutow, natomiast pomidorowa naprawde rewelacyjna, domowa.\nTatar wykanczany jest przy stoliku przez usmiechnietego Pana. Tatar jest rewelacyjny, podany z klasycznymi dodatkami, doprawiony idealnie, mieso jest naprawde rewelacyjne.\nNa dania glowne zdecydowalismy sie na schabowego, policzki wolowe oraz mielone. Z dodatkow postawilismy na mizerie, buraczki, bukiet surowek i puree. Kazde danie jest naprawde pyszne. Dodatki sa wspanialym dopelnieniem dania, cieple dobrze doprawione burczaki, bukiet surowek - swiezy i pyszny a puree idealnie kremowe.\n\nZdecydowanie warto tutaj wpasc, my z checia bedac w Warszawie ponownie odwiedzimy ten lokal. Ceny nie sa niskie, jednak jakosc wynagradza takie sumy i z przyjemnoscia ponownie zagoscimy w Starym Domu.",
