        review_text:
          "Zaczne od jedzenia..\nRosol praktycznie bez makaronu i z dodatkiem magii lub kostki. Schabowy bardzo dobry, plus za ziemniaczki z maselkiem, bardzo duzy minus za mizerie bez smaku, z sama smietana i bardzo grubo pokrojonymi ogorkami(uwiecznilam je,a i tak dopiero po zjedzeniu najgrubszego).\nKlimat i wystroj..\nNiby gosciniec i polskie pierogi, a w srodku bardzo nowoczesny wystroj.. slabo\nOBSLUGA, bo to byl najwiekszy zart..\nObslugi trzeba sie prosic o wszystko, prosba o zlozenie zamowienia kelnerka nr 1, prosba o domowienie kelnerka nr 2, przyniesienie napoi kelnerka nr 3, kelnerka nr 1 podchodzi zbiera naczynia i zero interakcji z gosciem, no i na koniec prosba o rozliczenie i podchodzi kelnerka nr 3.. zaplacilysmy, oczywiscie bez napiwku, bo obsluga to dramat. Jakie moje zdziwienie jak sprawdzam rachunek a tam ok. 8% serwisu juz doliczonego. Zawolalam menadzerke i zapytalam jak to jest z tym serwisem. Serwis doliczaja do kazdego zamowienia od 35 zl.. czyli tak naprawde do 90%. Mowie tej Pani, ze te kelnerki nie zasluguja na zadne napiwki, bo napiwek kelner dostaje za dobra obsluge, a ich obsluga pozostawia wiele do zyczenia. Pani nie wiedziala co mi odpowiedziec wiec powiedziala po prostu ,,tak u nas jest,,. Jak kelner ma automatycznie doliczany serwis, to jest to wiadome, ze obsluga bedzie wlasnie tak wygladac, bo po co ma sie starac, skoro i tak dostanie.. zart. Proponuje nie popelniac mojego bledu i sprawdzic najpierw rachunek i jak obsluga sie nie podoba, to zwrocic uwage menadzerowi, ja bym nie zaplacila tej kwoty serwisu, gdybym zauwazyla to wczesniej. Cala ekipa tego lokalu nastawiona na masowke, a nie na dobra jakosc i obslugi i jedzenia.",
