        review_text:
          "Wybralem sie tutaj sugerujac sie opiniami. I miejsce faktycznie broni sie smakiem.\n\nNa start dostalismy czekadelko w postaci cieplego i chrupiacego chleba z dobra oliwa z oliwek, marynowanym czosnkiem i oliwkami. Fajny starter zapowiadal ciekawe i smaczne doswiadczenie z kuchnia:)\n\nZamowilem zeberka klasyczne. Mieso miekkie i idealnie odchodzace od kosci. Bardzo przyjemne doswiadczenie. Za 60 zl dostajemy pelen zestaw warzyw, frytek, sos i przyzwoity kawalek miesa. Calosc troche slona ale bardzo dobra.\n\nNa minus troche ceny alkoholi i drinkow. Natomiast Long Island Ice Tea za 47zl to jest to sporo az za bardzo, zwlaszcza ze, alkoholu w nim za duzo nie bylo. W samym lokalu jest tez troche za glosno, muzyka do lekkiego sciszenia:)\n\nPodsumowujac, wizyta bardzo udana. Jedzenie bardzo smaczne i warte ceny, gdzie w innych tego typu obiektach za dodatki trzeba oddzielnie doplacic. Goraco polecam wybrac sie na testy i ich zeberka, ktore bym powtorzyl ponownie!",
