          "Zdecydowanie jedna z najlepszych restauracji w Warszawie: lokalizacja w scislym Centrum; przepyszne jedzenie w rozsadnych cenach, pieknie podane; sympatyczna obsluga.\nW zwiazku z tym, ze odwiedzilam restauracje w ramach imprezy integracyjnej, wyprobowalismy mnostwo dan, z ktorych wiekszosc byla przepyszna.\nPrzystawki:\nTatar z poledwicy wolowej, carpaccio z marynowanej poledwicy wolowej, rozplywajacy sie w ustach sledz matias w oleju lnianym, krewetki w sosie winno-maslanym, salatka z grillowanym kurczakiem i halloumi, rydze na masle czosnkowym -> przepychota!!!\nHummus z pita i grillowanym boczniakiem, deska serow oraz deska wedlin -> w porzadku, ale nic nadzwyczajnego\nTatar z lososia z imbirem, kawiorem i wasabi - nie przypadl nam do gustu\nZupy:\nZurek z kielbasa i jajkiem, zupa grzybowa z kluskami gnocchi, zupa rybna z owocami morza i warzywami -> rewelacyjne w smaku, gigantyczne porcje, aromatyczne, z bogata wkladka\nII dania:\nBurger wolowy z szarpanym miesem z dzika oraz poledwica wolowa sezonowana na mokro -> mistrzostwo swiata! Zdecydowanie najlepsze pozycje z menu\nDorsz z pieca z puree ziemniaczanym, gesie udo z czerwona cebula i wedzona sliwka, osmiornica z parpadelle warzywnym -> bardzo dobre, ale nie rewelacyjne\nKrolik marynowany w ziolach z kluskami lowieckimi -> najslabsze danie\nDesery:\nObledna beza z mascarpone i owocami; sernik z biala czekolada i jagodami oraz tiramisu -> wszystko bardzo dobre\nZ calego serca polecam kazdemu. Wybor dan jest olbrzymi, co mogloby swiadczyc o kiepskiej jakosci, jednak nie tutaj. Jedzonko rewelacyjne ",
