          "Jedzenie srednio mi smakowalo, a porcje oceniam jako niewielkie. W moim odczuciu zachowanie obslugi bylo nieprofesjonalne, przez co atmosfera w lokalu byla napieta. Nie czulam sie komfortowo posilajac sie w tym miejscu.\n\nSzczegolowo rozwinieta opinia i uwagi zostaly przekazane do managera.",
        published_at: "4 dni temu",
        published_at_date: "2024-10-29T12:02:12",
        response_from_owner_text:
          'Szanowna Pani, po pojawieniu sie Pani opinii jej tresc zostala zweryfikowana. Dwie kolezanki kelnerki ktore pracowaly tego dnia absolutnie nie potwierdzaja ponizania za strony kolegi i innych wymienionych tresci. Jest to zwyczajne szkodzenie firmie. Kolezanki ktore byly tego dnia w pracy moga to potwierdzic.\nProsze o kontakt w sprawie tresci na podany adres mailowy ponizej.\nW przypadku braku kontaktu tresc opinii zostanie skierowana jako szkodzenie firmie.\n\nOdwiedzili nas Panstwo w cztery osoby. Zamowili Panstwo trzy zupy i dwie salatki, z czego jedna osoba zamowila zupe i salatke, pierwsze i drugie danie. Zaserwowalismy Panstwu trzy zupy i salatke, natomiast druga salatka powinna byc zaserwowana po zupie dla tej jednej osoby. Nie zostala zaserwowana poniewaz stwierdzili Panstwo, ze za dlugo czekaja. Zamowienie zostalo zlozone o 16:47, prosba o "wydanie" drugiej salatki byla o godzinie 17:07. W ciagu 20 minut zupy z jedna salatka zostaly wydane i skonsumowane przez Panstwa. Po 10 minutach od prosby o druga salatke stwierdzili Panstwo iz czas oczekiwania jest za dlugi. Rachunek podany o godzinie 17:19.\nProsze o szczera analize czasu oczekiwania, przebywali Panstwo w restauracji 30kilka minut.\nUprzejmie prosze o kontakt w sprawie tresci opinii - manager@kameralnarestauracja.pl , dziekuje.',
