        review_text:
          "Restauracja Wiesz co Zjesz przygotowywala nam catering caly w opcji bezglutenowej na nasze wesele, oraz poprawiny w formie grilla i powiem szczerze to byl strzal w dziesiatke! Poczawszy od swietnego kontaktu mailowego i osobistego z Pania Iwonka, po przez pelne zaangazowanie, profesjonalizm  i serdecznosc kelnerow (Pani Edyty i Pana Michala, ktorych serdecznie pozdrawiam!), az po przepyszna kuchnie, ktora serwuje szef kuchni - Pan Rafal. Goscie juz podczas wesela zachwalali potrawy i dopytywali, gdzie serwuja na codzien tak pyszne jedzenie. Wszystko dobrze doprawione, estetycznie podane, rozplywajace sie w ustach! Osoby chorujace na celiakie czuly sie bardzo dobrze po weselu, a pozostali goscie, ktorzy na codzien nie maja stycznosci z dieta bezglutenowa nie odczuli roznicy. Wszystkim serdecznie polecam ta restauracje, ale przede wszystkim tych ludzi, ktorzy tworza te miejsce!",
