          "Pyszne jedzenie, obsluga bardzo mila i profesjonalna. Zeberka byly bardzo dobre, dobrze przygotowane mieso ladnie odchodzilo od kosci. Stek z kurkami byl po prostu swietny - bardzo udane polaczenie. Wszystko bylo odpowiednio przyprawione. Stek zamowilem z wysmazeniem o stopniu medium-rare i wydaje mi sie ze podane mieso bardziej wchodzilo juz w stopien medium, natomiast jest to kwestia umowna i kazdy inaczej to moze interpretowac, nie mniej stek byl bardzo dobrze przygotowany, mieso bylo mieciutkie i kruche. Zupa rybna byla wybitna i szczerze mowiac wrocilbym do tego miejsca nawet dla samej tej zupy. Na deser otrzymalismy tiramisu oraz creme brulee, ktore rowniez byly bardzo dobre.\nCzas oczekiwania byl krotki, bardzo szybko podana zostala zupa i niewiele pozniej drugie danie.\nNa pewno wroce. Polecam!",
