        review_text:
          "EDIT: Cofam swoja poprzednia gwiazdke za obsluge , jak widac jest nierowna. W dniu 17.10.24 przyszlam do Pianki z dawno niewidzianym znajomym. Nastawialismy sie na dlugie posiedzenie. Dodam, ze to ja mu Pianke zareklamowalam...A najadlam sie wstydu. Zamowilismy dwa burgery, piwo i wino. Kelnerka chciala nam zabrac karte , wiec kolega zaprotestowal. Od razu pomyslalam, ze to dziwne, ale zwalilam na karb mozliwego swiezego zatrudnienia kelnerki. Moze nie wie, ze zwykle kelnerzy proponuja zostawienie jednej karty. Bylam w Piance 16.05. O godzinie 16.43, kiedy mialam przed soba jeszcze cale frytki i pol kieliszka wina , ta sama kelnerka podeszla do stolika i powiedziala, ze od 17.00 jestem rezerwacja i mozemy zostac max do 16.50.\nChodze duzo po lokalach , ale czegos takiego to jeszcze nie widzialam. Kes doslownie stanal mi w gardle. Czyli mam 7 minut na zjedzenie i wypicie?\nChyba takie rzeczy , jak rezerwacja calego lokalu komunikuje sie klientowi wczesniej, moze wcale by nie usiadl na 40 minut.\nJestem tak zdegustowana , ze brak mi slow.\nRzadko narzekam, co widac po moich opiniach, w wiekszosci sa bardzo dobre.\nDodam, ze poszlismy do pobliskiej restauracji i siedzielismy jeszcze ok.3h a rachunek byl rzedu 400 zl, wiec nie przyszlismy na jedna kawe.\nPrzy okazji dodam, ze wino bylo BARDZO zle. Ale moze to juz moj gust.\n\nPoprzednia opinia:\nObledne desery, bardzo polecam. Gruszka klasy lux!",
