        review_text:
          'Miejsce super, wystruj klimatyczny gdzie mozna w spokoju siasc i porozmawiac lub pobiesiadowac z przyjaciolmi, czysto i schludnie bez przepychu czy "bibelotow".  Korzystalismy z uslug tej rest i w lokalu jak i na wynos. Jedzenie jak narazie trzyma fason ze swiezoscia jak i smakiem. Jak za pierwszym razem (ok Luty24\') bylismy zauroczeni smakiem dan (krewetki, pizza, steak) tak do tej pory jest ok. Z calego serca polecam krewetki  maslany lekko ostry sos i krewetki al\'dente z cieplym chlebkiem - wymiataja. Wingsy tez super - mieso nie wysuszone smaczne. Steak na kamieniu przyrzadzany wedlug wlasnego uznania ale mieso smaczne, warzywa doprawione i kruche. Zeberka - duza porcja a frytki z batatow chrupkie i doprawione. Makarony smaczne lecz nie wszystkie maja sosy odpowiednio przyprawione  - chyba poprostu rozne osoby/kucharze przyrzadzaja dania. Pizza zawsze jest ok, skladniki w odpowiedniej proporcji a ciasto kruche. Burgery smaczne, mieso swieze a bulka chrupiaca - duze porcje. Banana Foster to kwit esensja smaku na koniec objadania sie . Obsluga ogolnie mila i pomocna chodz czesto "zagmatwana" podczas ruchu. Co do drinkow to nie ma "szalu" ale znosnie, chodz przydal by sie dobry kurs barmanski  - ale nie samym alko czlowiek zyje . Ogolnie polecam bo jak szczegoly mozna pozmieniac /doprecyzowac tak jakos jedzenia sie "jak narazie" nie zmienia i oby wlasciciel o tym pamietal, bo coraz mniej tak dobrych miejsc w Tarnowie.',
