    description:
      "Lord Jack to klimatyczne,wyjatkowe miejsce na kulinarnej mapie Rzeszowa, doskonale na rodzinne obiady, wyjscia z przyjaciolmi, spotkania biznesowe oraz imprezy okolicznosciowe.\nUmiejscowiony w podziemiach rynku swoim klimatem nawiazuje do tradycyjnych piwnic, gdzie pedzono najlepsza whisky. Wlasnie ten trunek jest motywem przewodnim lokalu a specjalnoscia Lorda Jacka szeroki wybor whisky z calego swiata. Dla znawcow i koneserow proponowany jest Jack Daniel's SINGLE BARREL SELECT, ktory zostal wyselekcjonowany i rozlany na potrzeby lokalu.\nLord Jack to rowniez wysmienita kuchnia polska i amerykanska, oparta na najwyzszej jakosci miesie. Szczegolnie polecane sa steki z poledwicy wolowej, zeberka czy burgery z wyjatkowymi sosami Jack Daniels.",
