        review_text:
          "Mialem przyjemnosc odwiedzic restauracje NOBO po raz pierwszy, zachecony rekomendacjami znajomych. Od momentu, kiedy przekroczylismy prog z partnerka, bylismy serdecznie przyjeci przez pania Wiktorie, ktora okazala sie prawdziwa perelka wsrod kelnerow  Jej profesjonalizm i przyjazne podejscie sprawily, ze poczulismy sie wyjatkowo \n\nZa jej rekomendacja zdecydowalismy sie sprobowac zeberek (wzielismy na wynos), ktore okazaly sie prawdziwym arcydzielem kulinarnym  Soczyste, doskonale przyprawione i rozplywajace sie w ustach - absolutny hit wieczoru!\n\nNie moglismy tez pominac pizzy, ktora okazala sie prawdziwa uczta dla zmyslow. Chrupiace ciasto, aromatyczne skladniki i perfekcyjnie dobrane dodatki sprawily, ze kazda kawalek byl niezwyklym doznaniem smakowym \n\nNa deser wybralismy fondanta czekoladowa, ktora byla prawdziwa rozkosza dla milosnikow slodkosci. Delikatna, rozplywajaca sie czekolada w polaczeniu z roznorodnymi dodatkami byla idealnym zakonczeniem tego kulinarnego festiwalu \n\nRestauracja NOBO to miejsce, ktore z pewnoscia odwiedze ponownie. Niezwykla obsluga, wysmienite jedzenie i przyjemna atmosfera sprawiaja, ze jest to miejsce warte kazdej chwili spedzonej przy stole.\n\nSerdecznie dziekuje za niezapomniane doswiadczenie i z niecierpliwoscia czekam na kolejna wizyte!",
