        review_text:
          "Juz kilka razy odwiedzilem Kuchnia Marche, a dzis zatrzymalem sie tutaj na sniadanie.\nJajecznica z boczkiem smazonym na masle byla doskonala, podobnie jak inne ich dania, ktorych probowalem. Kanapka byla swieza, a kawa swietna. Cena jest ogromnym plusem -- okolo polowy ceny sniadania w naszym hotelu, z dodatkowym 20% rabatem.\n\nOgladanie kobiet robiacych pierogi na twoich oczach w porze obiadowej jest przyjemnoscia. Roznorodnosc dan jest imponujaca, od kuchni chinskiej i polskiej po pierogi, nalesniki i szeroki wybor salatek. Dostepne sa rowniez kompoty i napoje, a takze zupy -- zwykle dwie opcje. To samoobslugowe rozwiazanie, wiec wybierasz, co chcesz, a twoj talerz jest wazony na koncu. Oferuja tutaj 20% rabatu dla studentow, emerytow, rodzin wielodzietnych i uczniow.\nPersonel jest przyjazny i pomocny, zawsze gotowy do wyjasnienia dan i polecenia.\n\nWystroj jest czarujacy, przywodzi na mysl przytulny wiejski domek gdzies na francuskiej prowincji.\n\nOgolnie rzecz biorac, jest to swietne miejsce, aby cieszyc sie pysznym posilkiem w bardzo przyjemnej atmosferze.",
