        review_text:
          '"Chleb i Wino" na Wyspie Spichrzow w Gdansku to miejsce, ktore zdecydowanie warto odwiedzic. Restauracja ma swietna lokalizacje, a sam lokal jest naprawde przytulny i elegancki, idealny na spotkanie z przyjaciolmi lub romantyczna kolacje.\n\nJedzenie bylo pyszne - swieze skladniki, dobrze doprawione i pieknie podane. Porcje w sam raz, zeby sie najesc, ale nie przejesc. Obsluga byla bardzo mila i pomocna, zawsze gotowa doradzic, co warto sprobowac.Jesli planujesz wizyte, koniecznie zarezerwuj stolik z wyprzedzeniem. Restauracja jest bardzo popularna i praktycznie zawsze sa kolejki, zwlaszcza w weekendy.\n\nPodsumowujac, "Chleb i Wino" to miejsce, do ktorego na pewno wroce i ktore moge z czystym sumieniem polecic kazdemu, kto szuka dobrego jedzenia w Gdansku.',
