        review_text:
          "Z oferty restauracji korzystalismy w ramach znizki Finebite.\nRestauracja przy Bazylice Mariackiej, ale niewielka, zwlaszcza , gdy jest wylaczony z obslugi ogrodek. Ciezko zatem o stolik w godzinach szczytu. My bylismy w deszczowy wieczor i przy jednoczesnej duzej rezerwacji w lokalu, przez co co chwile klienci odchodzili z kwitkiem lub musieli poczekac.\nWnetrze restauracji bardzo skromne, prosto urzadzone, ale estetyczne. Toaleta niestety po calym dniu wymagala juz dolozenia recznikow papierowych czy oproznienia kosza, chociaz i ogolne ogarniecie jej tez by nie zaszkodzilo. Za to daje 2 na 5 gwiazdek, bo papier toaletowy i mydlo bylo.\nJedzenie przepyszne, pieknie podane, doprawione idealnie. Piers z kaczki nie byla przeciagnieta. Desery delikatne, rozplywajace sie w ustach. Drinki bardzo smaczne. Naprawde nie ma sie do czego doczepic (kazde z nas zamowilo inne potrawy z przystawek, dan glownych i deserow, a takze drinki) i stad 5 na 5 gwiazdek.\nW porownaniu do jakosci jedzenia obsluga wymaga poprawy. Ani razu nikt nie spytal, czy wszystko smakuje, czy dania w porzadku, czy cos jeszcze podac, nawet czy przyniesc rachunek, chociaz w lokalu byly cztery osoby z obslugi. Bylismy tam dwie godziny i naprawde czulismy sie zaniedbani. Goscie przy stoliku obok, gdzie byly 4 osoby, ktore przyszly po nas i byly znacznie krocej, byli pytani o dania i zawsze ktos z obslugi krecil sie przy nich. Z ostatnich naszych kilku wyjsc do restauracji ten pod katem obslugi byl najslabszy. Nawet w ciut gorzej ocenianych restauracjach nie zdarzylo nam sie doswiadczyc tak slabej obslugi, a szkoda, bo jedzenie jest naprawde na wysokim poziomie.\nDla jedzenia bym wrocila, ale reszta mnie nie kupila.",
