        review_text:
          "Do pierogarni Mandu zawitalismy w miare wczesnie, aby ominac kolejki. Zamowilismy krem z bialych warzyw, pierogi gotowane z farszem z dzika i ruskie oraz pierogi na ciescie drozdzowym z farszem z kurczaka z dodatkiem serka smietankowego i jalapeno.\nZaczne moze od najlepszego - czyli pierogow ruskich. Bez dwoch zdan jedne z najlepszych ruskich jakie jadlam, doskonale ciasto, pyszny farsz. Doslownie obled :)\nPierogi z dzika oraz na ciescie drozdzowym byly smaczne, jednak farsz z miesem z dzika byl troche bez smaku, a pierogi drozdzowe byly lekko mdle w smaku, przez co w polowie juz ciezko bylo jesc (przez co musialam podkrasc ruskiego kolezance).\nKrem z bialych warzyw smaczny, cenowo bardzo oplacalny.\nMiejsce z domowym klimatem, obsluga przemila, ogromny plus za menu dla pieskow. Pyszne piwka",
