        review_text:
          "Cala nasza wizyta przebiegla sprawnie, szybko, bardzo smacznie i ogolnie wspaniale.\nStalismy w kolejce przed lokalem kolo 20 minut. Super metoda na pilnowanie kolejki i ogolnego jej ruchu i zapraszania gosci przez kelnerow to lista, w ktorej po kolei kazdy jest zapisywany, dzieki czemu kelnerzy nie gubia sie i sa w stanie zapraszac od razu gosci jezeli stolik sie zwolni.\nSa tez poduchy zeby usiasc.\nStojacym w kolejce proponowane sa takze napoje.\nBardzo duzo pierogow do wyboru, kazdy znajdzie cos dla siebie.\nJa postanowilam poszalec i sprobowac pierogow z farszem z dzika. Ciasto pierogowe bardzo dobre, cienutkie. Niestety dzik nie przypadl mi do gustu, mial taki jak dla mnie jalowy, mdly smak.\nAczkolwiek na pewno komus takie mieso smakuje.\nWzielismy tez piecuchy z wolowina w sosie kentucky i to byla najlepsza pozycja, ciasto jak i farsz mega dobry.\nSos kentucky do nich pycha.\nTo pozycja, ktora mam nadzieje, ze jeszcze zjem.\nSos chilli-bazylia top \nNa doprawienie sie poprosilismy o pierogi mandu, czyli te smazone na glebokim oleju. Pozycja dobra, aczkolwiek po zjedzeniu kilku ma sie przesyt tego tluszczu.\nWedlug mnie lepiej probowac tych gotowanych badz pieczonych.\nHerbatki bardzo dobre, takze duzy wybor.\nObsluga profesjonalna, wszedzie jej pelno, bez problemu odpowiadaja na pytania zwiazane z menu. Mozna bylo poczuc sie tam zaopiekowanym.\nJak najbardziej polecam postac troche w kolejce.",
