        name: "D L",
        reviewer_profile:
          "https://www.google.com/maps/contrib/112465414371524531602?hl=pl",
        review_text:
          "Klimat ok, dosyc elegancko, ekskluzywnie nawet. Obsluga mila, staraja sie, chociaz dosyc dlugo czekalismy na dania a znajomi kelnera ktorzy przyszli kilka min po nas, dostali wczesniej obiad. Oni pewnie wystawia za obsluge 5*, ja za to obnizam bo na tym poziomie lokalu nie powinno byc kolesiostwa. Jedzenie ok, nie wybitne ale tez nie ma do czego sie czepiac. Poprawne, dobre ale nic wiecej. Jest drogo. Lemoniada 40zl! uwazam za spore przegiecie.\nPrzyjemnie spedzony czas, ze wzgledu na ceny nie bylo tlumow.\nNa plus ze nie wpuszczaja golasow, przy mnie kelner milo lecz stanowczo odmowil plazowiczowi wejscia. I bdb bo srednio sie je patrzac na spasionego Sebe w gaciach :-)",
        published_at: "2 miesiace temu",
        published_at_date: "2024-09-03T03:37:01",
        response_from_owner_text:
          "Szanowny Panie\n\nDziekujemy za poswiecenie czasu na podzielenie sie swoja opinia. Bardzo cieszy nas, ze docenili Panstwo atmosfere naszego lokalu oraz profesjonalne podejscie obslugi, zwlaszcza w kwestii dbania o odpowiedni dress code. To dla nas wazne, aby nasi goscie czuli sie komfortowo i mieli zapewnione przyjemne otoczenie podczas wizyty.\n\nPrzepraszamy jednak za sytuacje zwiazana z dluzszym oczekiwaniem na dania i wszelkie niedogodnosci z tym zwiazane. Zwrocimy szczegolna uwage na tego typu przypadki, aby zapewnic rowne traktowanie wszystkich naszych gosci. Wasza uwaga jest dla nas cenna i pomoze nam poprawic jakosc obslugi, ktorej przywiazujemy duza wage.\n\nJesli chodzi o ceny, zdajemy sobie sprawe, ze moga one wydawac sie wysokie, ale sa one odzwierciedleniem jakosci produktow, z ktorych korzystamy oraz poziomu, jaki staramy sie utrzymac, oferujac eleganckie doswiadczenia kulinarne.\n\nDziekujemy raz jeszcze za konstruktywna opinie. Mamy nadzieje, ze mimo pewnych zastrzezen, ponownie nas Panstwo odwiedza, a my dolozymy wszelkich staran, aby kolejna wizyta byla jeszcze lepsza.\n\nZ wyrazami szacunku,\nZespol Restauracji Nad Potokiem\n\n",
