          "Mialem dzis przyjemnosc zjesc posilek w Viceversa w Gdansku i musze przyznac, ze bylo to niezapomniane przezycie. Od wejscia przywital nas niesamowicie uroczy kelner Krzysiek, ktory sprawil, ze dzisiejszy dzien byl naprawde wyjatkowy. Jego charyzma i pasja do wloskiej kuchni natychmiast przeniosly nas do serca Wloch.\n\nZaczelismy od Bruschetty al pomodoro, ktora byla po prostu boska. Pomidory byly swieze i pelne smaku, doskonale uzupelnione chrupiacym pieczywem. Na danie glowne wybralem Tagliatelle al Tartufo. Nasaczony truflami makaron byl idealnie ugotowany, a bogaty i kremowy sos sprawil, ze nie moglam sie nim nacieszyc.\n\nNa zakonczenie posilku skusilam sie na Fondant al cioccolato. Cieply, lepki czekoladowy srodek byl niebianska rozkosza, stanowiac idealne zakonczenie fantastycznego posilku. Oprocz tych dan, delektowalem sie orzezwiajacym Aperitivo Martini Floreale & Tonic, ktore dodalo uroczego, aromatycznego akcentu do tego doswiadczenia.\n\nOgolnie rzecz biorac, Viceversa oferuje wspaniale polaczenie pysznego jedzenia, zachwycajacej atmosfery i wyjatkowej obslugi, a Krzysiek byl wyrozniajaca sie gwiazda wieczoru. Goraco polecam te restauracje kazdemu, kto szuka autentycznego smaku Wloch w Gdansku.",
