          'Swojski Smak to rewelacyjna restauracja ze swietnym jedzeniem i obsluga. Zadna pozycja z menu nie zawodzi smakiem ani wielkoscia porcji. Czesto okazuje sie nawet, ze trudno zjesc cala porcje, wiec odwiedzajac to miejsce wiadomo za co sie placi.\n\nDrobnym minusem jest brak warzyw/surowek do czesci dan i trzeba je domowic, jesli ktos ma ochote a ceny dodatkow nie sa male (za mizerie lub surowke trzeba doplacic 10 zl). Byc moze jest to kwestia podazania za tradycja kompozycji dan, jednak warto zwrocic na ten fakt uwage.\n\nInformacje dodatkowe:\n- Jesli ktos by sie zastanawial to zwierzeta sa akceptowane, ale tez bardzo lubiane w tym miejscu. Na pewno zwierzak dostanie pojemnik z woda do picia!\n- Nie otrzymamy w tej restauracji tzw. "czekadelka" po zlozeniu zamowienia, natomiast przy rozliczeniu platnosci zawsze otrzymujemy kilka owocowych landrynek.\n- Restaruacja od samego otwarcia jest pelna gosci, wiec samo to swiadczy o wyjatkowosci tego miejsca!\n- Przy samym wejsciu do restauracji znajduje sie parking miejski, jednak czesto brakuje miejsc do postoju. Mimo to w poblizu, na ul. Rybaki Gorne jest sporo miejsc parkingowych.',
