        review_text:
          "Przyjemne, klimatyczne miejsce z ciekawa kuchnia, tuz przy poznanskim rynku.\n\nPierogi idealne, naleza sie uklony w strone Pani, ktora je robi. Idealne ciasto, a naprawde trzeba wiedziec jak takie zrobic. Aczkolwiek podane nieco za chlodne - czekaly zbyt dlugo, to taki organizacyjny szczegol. Starty ser na nich zdazyl juz stwardniec. Gdyby nie ta temperatura, to zdecydowanie najlepsze danie.\n\nWatrobka moglaby byc odrobine krocej smazona (z watrobka czasem na sekundy, nie na minuty ;) ), ale plus za watrobke jako przystawke, bardzo rzadko spotykana w restauracjach, a szkoda. Naprawde dobra przystawka. Prosta, ale w punkt.\n\nTatar w porzadku, dressing z tartych skorek pomaranczy bardzo ciekawy. Chociaz to jeden z tych tatarow, ktore nie zapadaja w pamiec. Ale definitywnie najslabszym punktem bylo pieczywo podane do niego - nie wiem kto je dostarcza, ale to bylo jedno z tych suchych, sypiacych sie, ktore kupuje sie w dyskontach.\n\nOprocz tego kilka szczegolow, ktore dzialaja zdecydowanie na minus:\nTalerz, na ktorym podano watrobke, byl wyszczerbiony (widac to na zdjeciu, przy swieczce).\nTonik zostal podany od razu w szklance, zapelnionej prawie do maksimum (okolo 1cm od gory, widac na zdjeciu), Powinien byc podany w butelce, nalany do szklanki przy stoliku, tylko czesciowo, butelka pozostawiona na stoliku, o takim szczegole, jak odwrocenie etykieta do Goscia juz nie bede wspominac... ;)\nI chyba najgorsze: kieliszki do wina nie byly wypolerowane - widac bylo na nich kropki z wody, po zmywarce. W restauracji tej klasy polerowanie szkla powinno byc standardem jak mysle. Byle knajpa z piwem poleruje szklanki.\n\nI tutaj byl taki zgrzyt, bo takie wlasnie szczegoly odrozniaja po prostu knajpe od restauracji pretendujacej do pewnego poziomu. To nie jest bardzo droga restauracja, ale mimo wszystko. Niewykorzystany potencjal.\n\nNie do konca jestem przekonana, czy chcialabym wrocic. Ten kontrast oczekiwania - restauracja vs. rzeczywistosc - knajpa jednak troche mnie uderzyl. Mocne 4/5, ale tylko tyle.\n\nNa zdjeciach:\n\nWatrobki z indyka flambirowane w anyzowym Ouzo, z glebokim sosem z czerwonych krwistych pomaranczy, podane z liscmi salat sezonowych i mlodym szpinakiem.\n\nPierozki z delikatna ricotta, twarozkiem kozim, liscmi mlodego szpinaku, serem Bursztyn i swiezo tarta galka muszkatolowa z aromatycznym palonym maslem i liscmi swiezej szalwii ogrodowej\n\nTatar z lososia baltyckiego z dressingiem z tartych skorek pomaranczy, czerwonym kawiorem, liscmi mlodego szpinaku i kapeluszem z creme fraiche",
