        review_text:
          "Zarezerwowalem miejsce przez Restaurant Week dla 2 osob, bo zaciekawilo mnie menu (kompozycja skladnikow), a korzystajac rok temu z restaurant week poprzeczka byla ustawiona dosc wysoko. To byl pierwszy raz w Bulwarze i mysle, ze ostatni. Na wstepie powiedziano nam, ze nie mozemy usiasc 15 min wczesniej i mamy sie jeszcze gdzies przejsc, bo stoliki sa przygotowywane. Wszystko byloby w porzadku, gdyby nie fakt, ze gdy wrocilismy stolik byl dokladnie ten sam i nikt go nie zajmowal (wczesniej sobie go upatrzylismy i byl przygotowany).\nWjechaly drinki, to ciezko zepsuc (choc zabraklo obiecanej czerwonej pomaranczy). Pozniej przystawki i tutaj zaczynaja sie problemy. Nierowne porcje wzgledem wege i nie-wege. Mieso w tatarze dobrej jakosci, sam jego smak tez jak najbardziej. Ale konfitury z pikantnej papryki nie zaznalismy, mieso bylo niedoprawione, zabraklo tego czegos. Buraczane ravioli w wersji wege mialy smak buraka i dominujace orzechy. Ciasto zdecydowanie za grube, ktos chyba sie uczy robic ravioli. Dyni nie czuc, a tym bardziej cynamonu i galki muszkatolowej, ktore sa bardzo aromatycznymi przyprawami.\nCo do dania glownego, to: znow nierownosc, ale odwrotnie - cala miska wege risotto, mialo byc z mlodymi rydzami (nie w sezonie? xD) a kelnerka podala i powiedziala, ze z kurkami. Znow totalnie zabity smak, same orzechy i ryz. Grillowana cukinia ratowala smak sama soba. A danie miesne za to bardzo male, bo 3 male ravioli, z grubym ciastem, dobrym miesem, bardziej w konsystencji pasztetu, czy terriny. Comber jelenia niewyczuwalny, a tym bardziej smak owocow runa lesnego, jak to ladnie bylo nazwane. Calosc ratowal sos z borowikow. Zabraklo jakiegos dodatku by calosc nie byla taka sucha i nijaka - np. Puree z topinamburu lub selera, nawet z ziemniakow z dodatkiem chrzanu robilo by robote i bylby mianownik wspolny z przystawka, gdzie znalazlo sie troche chrzanu.\nNo i deser XD creme brulee, czyli budyn z warstwa nie do konca skarmelizowanego cukru. Nawet nie bylo co tam sobie rozbic, bo byl to po prostu cukier jeszcze w ziarenkach, momentami troche bardziej stopiony.\nSorbet z porzeczki dobry, taki jakiego sie spodziewalismy. Caly deser moglby byc podawany razem jako jeden, oddzielnie troche maly i o niczym. Calosc podsumowuje tak, ze rok temu jadalismy o wiele lepiej, w nizszej cenie restaurant weeku i u chefow ktorzy faktycznie wiedzieli co chca robic. Tutaj pojawily sie jakies dania, ktore chyba nie do konca odpowiadaja restauracji, patrzac na to, ze ludzie obok zamawiali najogolniej zurek, rosol itp.\nNiestety, ale od siebie nie polece, bo bardzo zalowalem, ze dalem sie skusic dobrze brzmiacymi nazwami dan.",
