        review_text:
          'Tradycyjnie polskie jedzenie na poznanskiej Srodce!\n\nJesli chcecie zabrac kogos na tradycyjne, polskie jedzenie, ktore bedzie swieze, smaczne i ladnie podane, to "Hycka" jest dobrym i solidnym wyborem w Poznaniu. Dodatkowym plusem sa wnetrza, ktore sa swojskie, ale nie przekraczaja granice tandetnej cepelii.\n\nZabralam moich gosci - Polakow z Monachium - stesknionych za domowymi smakami i byli zachwyceni. Mieso bylo delikatne, w golonce z latwoscia odchodzilo od kosci, dobrze przyprawione, dodatki smaczne, podkreslajace smak calosci. Porcje spore, calosc sycaca. Nie dalismy rady znalezc miejsca na deser  Do tego do picia, oprocz standardowych napoi i alkoholi, oferowane sa napoje z tytulowa hycka, czyli syropem z kwiatow czarnego bzu (syrop robiony na miejscu, mozna tez kupic na wynos). Zdecydowanie warte sprobowania - zwlaszcza przez gosci, ktorzy nie mieli jeszcze na to okazji.\n\nObsluga jest mila i chetnie wytlumaczy szczegoly menu.',
