        review_text:
          "Zacheceni dobrymi opiniami pojawilismy sie w lokalu na sniadaniu. Usiedlismy z psem na ogrodku. Nie znalezlismy nigdzie informacji o tym ze trzeba isc zamowic posilek na dol do obslugi, ale zauwazylismy ze nikt z obslugi nie podchodzi. Zamowilam dwa sniadania i dwie kawy. Juz przy przyjmowaniu Pani byla wyniosla, jej ton byl po prostu niegrzeczny, taki z pretensjami: gdzie siedzimy? Czy na zewnatrz? Rozumiem ze to tylko pytania, ale na prawde sposob wypowiedzi ma bardzo duzy wplyw na calosc konwersacji... do stolika przyniesiono nam kawy. Nikt nas nie poinformowal, ze czas oczekiwania na sniadanie bedzie dluzszy. Otrzymalismy sniadanie po 40 minutach czekania, slabo.\nAle przechodzac do samego posilku, bo liczylismy ze to uratuje cala sytuacje i warto troche pocierpiec. Ale niestety, jedno wielkie rozczarowanie. Zoltka w jajkach sciete na kamien... zarowno moje poche jak i sadzone. Kaszanka zimna, boczek zimny i malo wysmazony, moj byl mocniej podsmazony ale chlopak otrzymal boczek ktory przypominal surowy, lekko obsmazany. Na prawde ciezko bylo znalezc plusy tych posilkow, bardzo bylismy zaskoczeni, moze trafilismy na kogos kto nie radzil sobie na kuchni? Bo az dziwne jest to ze jedzenie bylo tak zle przyrzadzone, a lokal ma tak duzo dobrych opini.\nDodatkowo, co tez bylo duzym zaskoczeniem, jest to pierwszy lokal ktory odwiedzilismy z psem, ktory nie zaproponowal wody dla psa, PIERWSZY, aczkolwiek to jest tylko taki niuans. Liczy sie jedzenie i obsluga, ale ani jedno ani drugie nie bylo nawet na akceptowalnym poziomie.",
