          "Miejsce o niesamowitym klimacie, przestrzeni oraz wspanialej obsludze.\n\nNa powitanie dostalismy do degustacji suszone pomidorki z wypiekanymi na miejscu mini buleczkami. - Wspaniale!\n\nNa przystawke sprobowalem Tatar. Mieso dobrze posiekane, majonez grzybowy w polaczeniu z tatarem byl naprawde przepyszny!\n\nJako danie glowne zamowilismy stek angus, ktory byl wysmazony idealnie, a jego smak byl dokladnie taki jakiego oczekiwalem. Do tego byl pieczony ziemniak oraz wspanialy, delikatny sos serowy, ktory pasowal perfekcyjnie do steka.\n\nDrugim daniem glownym byla oczywiscie rolada. Krucha, soczysta, bardzo smaczna, do tego kluski Slaskie oraz kapustka. Cale danie bardzo dobre, niemniej jednak uwazam, ze jest jedno miejsce w Katowicach, ktore serwuje jeszcze lepsza rolade ;)\n\nKolacje uwazam za udana. Miejsce bardzo klimatyczne, pyszne starannie przygotowane jedzenie oraz wspaniala obsluga. Goraco polecam!",
