        review_text:
          "Miejsce klimatyczne, menu z duzym wyborem.\nW niedziele dosc dlugi czas oczekiwania na potrawy, wszystkie zamowione dania przyszly o jednym czasie. Ale przyszly... letnie. Za chwile byly juz zimne. Polmisek owocow morza wyborny, moze poza risotto.\nDesery poprawne.\nCo do obslugi Glowny Pan ktory nas obslugiwal byl uprzejmy, usmiechniety, no wzor. Pod koniec wizyty, przy deserze, pojawila sie czarna owca restauracji, niejednokrotnie wspominana w komentarzach.\nPan obrazony, wywracajacy oczami, walnal talerze jak leci przy czym ja swojego nie dostalam poniewaz stwierdzil ze polozy talerz na srodek ;) Nie wiem czy to ktos z rodziny i dlatego dalej pracuje ale Pan nadaje sie co najwyzej na magazyniera, absolutnie nie do pracy z klientem. Mimo wszystko wizyte uwazam a udana.",
