          'Mam dosc mieszane uczucia na temat tego miejsca. Duzym plusem restauracji jest jej lokalizacji tuz przy Parku 3 Stawy. Widok z ogrodka, tym bardziej w letnia pogode, jest wspanialy! Dodatkowo, widac, iz serwowane jedzenie jest dobrej jakosci i naprawde jest smaczne. Zastrzezenia mam wylacznie do obslugi, bo mam wrazenie, iz delikatnie "skreslili nas" ze wzgledu na dosc luzny ubior ( podkreslam, sa to nasze odczucia - nikomu nic nie zarzucam ). Jak jeszcze menu dostalismy w miare szybko, to na napoje czekalismy juz okolo 10 minut ( zamowilismy wode oraz piwo ). I nie, restauracja nie byla oblezona przez klientow. Na dania rowniez swoje odczekalismy - w miedzyczasie skonczyly nam sie napoje i kelner zainteresowal sie tym dopiero wtedy, gdy przyniosl nam zamowione posilki. Juz nie wspomne o poproszenie o rachunek. Gdyby nie drugi pan kelner, obslugujacy inne stoliki, zapewne musielibysmy podejsc do baru by moc cokolwiek oplacic. Gdyby nie jedzenie i lokalizacja restauracji - otrzymalaby ona tylko 3 gwiazdki. I ze wzgledu na taka, a nie inna, obsluge - juz tam nie zawitamy.',
