          "Wybralismy Tatiane skuszeni tradycyjna kuchnia slaska z twistem i nie zawiedlismy sie. W trakcie 4-dniowego pobytu w Katowicach jedlismy tutaj obiad dwa razy.\n\nObsluga jest naprawde super, klimat miejsca rowniez ale jedzenie - prawdziwa bomba! Juz czekadelko zapowiada dobra uczte bo podany chleb jest pyszny, twarozek super, a smalec wrecz wyborny. Koniecznie trzeba sprobowac zur. Zarowno forma podania z puree, grzybami, kielbasa i jajkiem, jak i sam smak jest fenomenalny. Totalnie 10/10!\nBardzo dobry jest tez tatar, rowniez podawany z pieczywem.\n\nNa dania glowne probowalismy rolade z dzika - swietna, pieczone zeberka - naprawde spora porcja na duzy glod z solidna iloscia ziemniakow z bobem i szpinakiem, podczas drugiego pobytu wpadl stek z poledwicy - bardzo smaczne mieso i super dodatki, oraz kotlet schabowy z koscia - rowniez spora porcja, mieso kruche, ale show skradl panczkraut z mlodej kiszonej kapusty (jakie to bylo dobre!!!).\n\nCeny nie naleza do najnizszych, ale moim zdaniem totalnie warto, bo jedzenie jest swietne!",
