          'Tatiane odwiedzilam zachecona rekomendacja youtubera. Za rada kelnera skusilam sie na kombinacje zur i krokiet, zamiast typowanej poczatkowo rolady slaskiej, ,,zeby sprobowac wiecej slaskich smakow". Zur byl bardzo dobry, moge z czystym sumieniem polecic. Bardzo kwasny, z puree ziemniaczanym, klopsikami, jajkiem, grzybami i cebula, tresciwy i sycacy, a do tego podany w bardzo ciekawy sposob (nalewany do talerza przy stoliku). Tutaj 5/5. Niestety krokiet to nieporozumienie. W skladzie wedzony ser, ziemniak, bob, te smaki byly niewyczuwalne, zostaly zupelnie przytloczone przez koperek. Powinno sie uczciwie postawic sprawe i nazwac to krokietem koperkowym, aby osoby ktore za koprem nie przepadaja wiedzialy, co je czeka. Ogolnie tresc tego krokieta to byla bardzo dziwna papka, zakladam ze byl tam surowy ziemniak starty jak na placek ziemniaczany, taka to mialo konsystencje. Do tego karmelizowana cebula, ktora byla tylko troche skarmelizowana, a bardziej kwasna. Biorac pod uwage rozmiar krokieta (krokiecik bylby tu lepszym okresleniem) i jego cene (30 PLN) - 1/5. In plus, fajne czekadelko, bardzo dobry chleb wypiekany na miejscu. Wino ok, karta win troche chaotyczna. Bardzo dobra obsluga. Klimatu miejsca nie poczulam poniewaz wskazano mi stolik na zewnatrz (przy 80% pustych stolikow w srodku). Ogolnie niestety wzgledem oczekiwan spore rozczarowanie, krokiet koperkowy polozyl sie dlugim cieniem na bardzo dobrym zurze. Przy nastepnej wizycie w Katowicach bede odwiedzac inne miejsca.',
