          "Swietnie miejsce, choc na pierwszy rzut oka wyglada niepozornie, zeby nie powiedziec malo zachecajaco - ot na jakas tania i marna jadlodajnie przy parku. Ale w srodku bardzo przyjemny klimat, choc widac, ze to lokal z wieloletnia tradycja i doswiadczeniem, no i rewelacyjne jedzenie. Pyszny rosol, kaczka, tunczyk, rolada, dodatki. Wszystko idealnie doprawione i skomponowane, elegancko podane. Przepyszny sernik. Mila, kompetentna, ale nie nadskakujaca obsluga kelnerska. W tygodniu tlumow nie ma, ale w weekendy wyobrazam sobie, ze o miejsce nie jest latwo. Naprawde warto sie wybrac, uczta dla zmyslow zapewniona. Polecam, choc ceny nie naleza do najnizszych.",
